import "./style.css";
import homePic from "../img/pic/14k5.jpg";
import locPin from "../img/icons/location.svg";
import Login from "../login/login.js";

const Main = () => {
    return (
      <div className="container">
        <div className="main">
          <ul className="main-header">
              <li className="main-header__item">
                <div className="main-header__item__grid-box">
                <Login />
                  <div className="main-header__item__info">
                    <div className="main-header__item__info__btn">Сдать показания</div>
                    <div className="main-header__item__info__btn">Написать обращение</div>
                    <div className="main-header__item__info__btn">Собрания собственников</div>
                  </div>
                </div>
              </li>
              <li className="main-header__item"> 
                <div className="main-header__item__container">
                  <div className="main-header__item__top-white-box"><div></div></div>
                  <img src={homePic} className="main-header__item__pic" tittle="Краснолесья 14к5 вид сверху" alt="Краснолесья 14к5 вид картинка"/>
                  <div className="main-header__item__bottom-white-box"><div></div></div>
                  <a href=""><img src={locPin} className="main-header__item__location" tittle="Краснолесья 14к5 на карте" alt="Краснолесья 14к5 вид картинка"/></a>
                </div>
              </li>
          </ul>
        </div>
      </div>
    );
  }
  
  export default Main;
